import { useRef } from "react";

const Contact = () => {
  return (
    <div id='contact'>
      <ul class="c-rainbow">
        <li class="c-rainbow__layer c-rainbow__layer--white">MADE BY FAHAD AHMAD</li>
        <li class="c-rainbow__layer c-rainbow__layer--orange">MADE BY FAHAD AHMAD</li>
        <li class="c-rainbow__layer c-rainbow__layer--red">MADE BY FAHAD AHMAD</li>
        <li class="c-rainbow__layer c-rainbow__layer--violet">MADE BY FAHAD AHMAD</li>
        <li class="c-rainbow__layer c-rainbow__layer--blue">MADE BY FAHAD AHMAD</li>
        <li class="c-rainbow__layer c-rainbow__layer--green">MADE BY FAHAD AHMAD</li>
        <li class="c-rainbow__layer c-rainbow__layer--yellow">MADE BY FAHAD AHMAD</li>
      </ul>
    </div>
  );
};

export default Contact;
